import React from "react";
import "./Add.css";
import FoodCard2 from "./Foodcard2.jsx";
import { useState,useEffect } from "react";
import axios from "axios";
import MenuIcon from '@mui/icons-material/Menu';
import { useNavigate } from "react-router-dom";
function Add() {
    const [isMenuOpen, setIsMenuOpen] = useState(false);
    const toggleMenu = () => {
        setIsMenuOpen(!isMenuOpen);
      };
    const year = new Date().getFullYear();
    


    useEffect(() => {
        axios.get('http://localhost:8081/Add')
            .then(res => {
                if (res.data.valid) {
                    console.log('success');
                } else {
                    navigate('/login');
                }
            })
            .catch(err => console.log(err));
    }, []);


    const navigate=useNavigate();
  


      const handleLogout = () => {
        axios.get('http://localhost:8081/logout')
            .then(() => {
                navigate('/login');
            })
            .catch(err => console.log(err));
    };


    const handleReload = () => {
        // Use navigate to reload the current page
        
        navigate('/', { replace: true });
        window.location.reload();
      };
    
    return (
      <div>
        <div className="home-container">
            <div className="menu">
                <button className="menu-btn" onClick={toggleMenu}>
                    <MenuIcon/>
                </button>
                {isMenuOpen && (
                    <div className="dropdown">
                    <button className="menu-item">Contact</button>
                    <button onClick={handleReload} className="menu-item">About Us</button>
                    </div>
                )}
            </div>
            <div className="tit">
                <h2 onClick={handleReload}><img src="/images/f3.png" alt=""/>FOOD NETWORK</h2>
            </div>
            <div className="buttons-container">
                <button onClick={handleLogout} className="sig-btn">Logout</button>
            </div>
        </div>
        


        <div className="card-container">
            <div className="body-content">
            <div className="input-box">
                        <label>Image Details:</label>
                        <input
                            type="file"
                            id="imageInput"
                            accept="image/*"
                        />
                    </div>
                    <div className="input-box">
                        <label>Food Name:</label>
                        <input type="text" placeholder="Enter food name" />
                    </div>
                    <div className="input-box">
                        <label>Donor:</label>
                        <input type="text" placeholder="Enter donor" />
                    </div>
                    <div className="input-box">
                        <label>Quality:</label>
                        <input type="text" placeholder="Enter quality" />
                    </div>
                    <div className="input-box">
                        <label>Quantity:</label>
                        <input type="text" placeholder="Enter quantity" />
                    </div>
                    <div className="input-box">
                        <label>Condition:</label>
                        <input type="text" placeholder="Enter condition" />
                    </div>
                    <div className="input-box">
                        <label>Food Type:</label>
                        <input type="text" placeholder="Enter food type" />
                    </div>
                
            </div>
            <button className="add-btn">Submit</button>
        </div>

        <div className="body-content1">
            <FoodCard2
            image="/images/food1.jpg"
            foodName="Delicious Food"
            donorName="John Doe"
            contact="123-456-7890"
            location="City, Country"
            quantity="10 kg"
            quality="Fresh"
            foodType="Vegetables"
            condition="Good"
            />
            <FoodCard2
            image="/images/food1.jpg"
            foodName="Delicious Food"
            donorName="John Doe"
            contact="123-456-7890"
            location="City, Country"
            quantity="10 kg"
            quality="Fresh"
            foodType="Vegetables"
            condition="Good"
            />
            <FoodCard2
            image="/images/food1.jpg"
            foodName="Delicious Food"
            donorName="John Doe"
            contact="123-456-7890"
            location="City, Country"
            quantity="10 kg"
            quality="Fresh"
            foodType="Vegetables"
            condition="Good"
            />
            <FoodCard2
            image="/images/food1.jpg"
            foodName="Delicious Food"
            donorName="John Doe"
            contact="123-456-7890"
            location="City, Country"
            quantity="10 kg"
            quality="Fresh"
            foodType="Vegetables"
            condition="Good"
            />
            
            
        </div>



        <div className="footer">
            <h3>Copyright â“’ {year}</h3>
        </div>
      </div>
    );
  }
  
  export default Add;
